sap.ui.model.DataState.!description:
Holds the status data of a binding. To react to changes of this status data, a control must implement the <code>refreshDataState</code> method, which is called with the name of the bound control property and the data state object as parameters. With the {@link #getChanges} method, the control can determine the changed properties and their old and new values. <pre>
    // sample implementation to handle message changes
    myControl.prototype.refreshDataState = function (sPropertyName, oDataState) {
       oDataState.getMessages().forEach(function (oMessage) {
           console.log(oMessage.getMessage());
       }
    }

    // sample implementation to handle laundering state
    myControl.prototype.refreshDataState = function (sPropertyName, oDataState) {
       this.setBusy(oDataState.isLaundering());
    }

    // sample implementation to handle dirty state
    myControl.prototype.refreshDataState = function (sPropertyName, oDataState) {
       if (oDataState.isDirty()) {
          console.log("Property " + sPropertyName + " of control " + this.getId()
              + " is dirty");
       }
    }
</pre>

With the {@link #getProperty} method, the control can read a property of the data state. The properties are <ul> <li><code>controlMessages</code> The {@link sap.ui.core.message.Message messages} created from type validation or parse errors on user input for a property binding <li><code>dirty</code> Whether the value was not yet confirmed by the server; use {@link #isDirty} to read this property <li><code>invalidValue</code> The control value that was rejected by type parsing or validation on user input for a property binding <li><code>laundering</code> Whether the value has been sent to the server but is not yet confirmed <li><code>messages</code> All messages of the data state <li><code>modelMessages</code> The {@link sap.ui.core.message.Message messages} available for the binding in its {@link sap.ui.model.Binding#getModel model} <li><code>originalValue</code> The <em>original</em> value of a property binding in {@link sap.ui.model.PropertyBinding#getExternalValue external representation} <li><code>value</code> The value of a property binding in {@link sap.ui.model.PropertyBinding#getExternalValue external representation} </ul>

