getODataProperty.!description:
Returns the given OData type's property (not navigation property!) of given name.

If an array is given instead of a single name, it is consumed (via <code>Array.prototype.shift</code>) piece by piece. Each element is interpreted as a property name of the current type, and the current type is replaced by that property's type. This is repeated until an element is encountered which cannot be resolved as a property name of the current type anymore; in this case, the last property found is returned and <code>vName</code> contains only the remaining names, with <code>vName[0]</code> being the one which was not found.

Examples: <ul> <li> Get address property of business partner: <pre>
var oEntityType = oMetaModel.getODataEntityType("GWSAMPLE_BASIC.BusinessPartner"),
    oAddressProperty = oMetaModel.getODataProperty(oEntityType, "Address");
oAddressProperty.name === "Address";
oAddressProperty.type === "GWSAMPLE_BASIC.CT_Address";
</pre> </li> <li> Get street property of address type: <pre>
var oComplexType = oMetaModel.getODataComplexType("GWSAMPLE_BASIC.CT_Address"),
    oStreetProperty = oMetaModel.getODataProperty(oComplexType, "Street");
oStreetProperty.name === "Street";
oStreetProperty.type === "Edm.String";
</pre> </li> <li> Get address' street property directly from business partner: <pre>
var aParts = ["Address", "Street"];
oMetaModel.getODataProperty(oEntityType, aParts) === oStreetProperty;
aParts.length === 0;
</pre> </li> <li> Trying to get address' foo property directly from business partner: <pre>
aParts = ["Address", "foo"];
oMetaModel.getODataProperty(oEntityType, aParts) === oAddressProperty;
aParts.length === 1;
aParts[0] === "foo";
</pre> </li> </ul>

extend.!description:
Defines a new subclass of WebComponent with the name <code>sClassName</code> and enriches it with the information contained in <code>oClassInfo</code>.

<code>oClassInfo</code> can contain the same information that {@link sap.ui.base.ManagedObject.extend} already accepts, plus the <code>dnd</code> property in the metadata object literal to configure drag-and-drop behavior (see {@link sap.ui.core.webc.WebComponent.MetadataOptions MetadataOptions} for details). Objects describing aggregations can also have a <code>dnd</code> property when used for a class extending <code>WebComponent</code> (see {@link sap.ui.base.ManagedObject.MetadataOptions.AggregationDnD AggregationDnD}).

Example: <pre>
WebComponent.extend('sap.mylib.MyElement', {
  metadata : {
    library : 'sap.mylib',
    tag : 'my-webcomponent',
    properties : {
      value : 'string',
      width : {
        type: 'sap.ui.core.CSSSize',
        mapping: 'style'
      }
    },
    defaultAggregation: "content",
    aggregations : {
      content : {
        type: 'sap.ui.core.Control',
        multiple : true
      },
      header : {
        type : 'sap.ui.core.Control',
        multiple : false,
        slot: 'header'
      }
    }
  }
});
</pre>

getChanges.!description:
Returns the changes of the data state in a map that the control can use in the <code>refreshDataState</code> method. The changed property's name is the key in the map. Each element in the map contains an object of below structure. <pre>
   {
       oldValue : The old value of the property,
       value    : The new value of the property
   }
</pre> The map only contains the changed properties.

extend.!description:
Defines a new subclass of Element with the name <code>sClassName</code> and enriches it with the information contained in <code>oClassInfo</code>.

<code>oClassInfo</code> can contain the same information that {@link sap.ui.base.ManagedObject.extend} already accepts, plus the <code>dnd</code> property in the metadata object literal to configure drag-and-drop behavior (see {@link sap.ui.core.Element.MetadataOptions MetadataOptions} for details). Objects describing aggregations can also have a <code>dnd</code> property when used for a class extending <code>Element</code> (see {@link sap.ui.base.ManagedObject.MetadataOptions.AggregationDnD AggregationDnD}).

Example: <pre>
Element.extend('sap.mylib.MyElement', {
  metadata : {
    library : 'sap.mylib',
    properties : {
      value : 'string',
      width : 'sap.ui.core.CSSSize'
    },
    dnd : { draggable: true, droppable: false },
    aggregations : {
      items : { type: 'sap.ui.core.Control', multiple : true, dnd : {draggable: false, droppable: true, layout: "Horizontal" } },
      header : {type : "sap.ui.core.Control", multiple : false, dnd : true },
    }
  }
});
</pre>

sap.ui.core.cache.CacheManager.!description:
This object provides persistent caching functionality. The component is both private and restricted to framework core usage. It is currently supported to a limited set of environments: <ul> <li>Google Chrome(version >=49) for desktop</li> <li>Internet Explorer(version >=11) for desktop.</li> </ul> For all other environments, a dummy (NOP) implementation will be loaded, see {@link sap.ui.core.cache.CacheManagerNOP}.

This object is not meant for application developer's use, but for core UI5 framework purposes.

The cache manager maps all entries to a single (current) UI5 version. If the cache is loaded with different UI5 version, all existing entries will be deleted.

Example usage: <pre>
sap.ui.define(['sap/ui/core/cache/CacheManager'],
   function(oCacheManager) {
      oCacheManager.get("myKey").then(function(value){
          if (value) {
              //process it
          } else {
              //obtain it and eventually store in the cache
              var oEntry = new Equipment();
              oCacheManager.set("myKey", oEntry);
          }
        });
      }
   });
</pre>

