extendConfig.!description:
Extends and overwrites default values of the {@link sap.ui.test.Opa sap.ui.test.Opa.config} field. Sample usage: <pre>
    <code>
        var oOpa = new Opa();

        // this statement will time out after 15 seconds and poll every 400ms
        // those two values come from the defaults of sap.ui.test.Opa.config
        oOpa.waitFor({
        });

        // All wait for statements added after this will take other defaults
        Opa.extendConfig({
            timeout: 10,
            pollingInterval: 100
        });

        // this statement will time out after 10 seconds and poll every 100 ms
        oOpa.waitFor({
        });

        // this statement will time out after 20 seconds and poll every 100 ms
        oOpa.waitFor({
            timeout: 20;
        });
    </code>
</pre>

load.!description:
Loads the given library and its dependencies and makes its content available to the application.

<h3>What it does</h3>

When library preloads are not suppressed for the given library, then a library-preload bundle will be loaded for it.

After preloading the bundle, dependency information from the bundle is evaluated and any missing libraries are also preloaded.

Only then the library entry module (named <code><i>your/lib</i>/library.js</code>) will be required and executed. The module is supposed to call {@link #.init} providing the framework with additional metadata about the library, e.g. its version, the set of contained enums, types, interfaces, controls and elements and whether the library requires CSS. If the library requires CSS, a &lt;link&gt; will be added to the page referring to the corresponding <code>library.css</code> stylesheet for the library and the current theme.

When the optional parameter <code>mOptions.url</code> is given, then that URL will be registered for the namespace of the library and all resources will be loaded from that location. This is convenience for a call like <pre>
  sap.ui.loader.config({
    paths: {
      "lib/with/slashes": mOptions.url
    }
  });
</pre>

When the given library has been loaded already, no further action will be taken, especially, a given URL will not be registered. A Promise will be returned, but will be resolved immediately.

<h3>When to use</h3>

For applications that follow the best practices and use components with component descriptors (manifest.json), the framework will load all declared mandatory libraries and their dependencies automatically before instantiating the application component.

The same is true for libraries that are listed in the bootstrap configuration (e.g. with the attribute <code>data-sap-ui-libs</code>). They will be loaded before the <code>init</code> event of the UI5 Core is fired.

Only when an app declares a library to be a lazy library dependency or when code does not use descriptors at all, then an explicit call to <code>loadLibrary</code> becomes necessary. The call should be made before artifacts (controls, elements, types, helpers, modules etc.) from the library are used or required. This allows the framework to optimize access to those artifacts.

For example, when an app uses a heavy-weight charting library that shouldn't be loaded during startup, it can declare it as "lazy" and load it just before it loads and displays a view that uses the charting library: <pre>
  await Library.load({name: "heavy.charting"});
  await View.create({
      name: "myapp.views.HeavyChartingView",
      type: ViewType.XML
  });
</pre>

setDisabledModifiers.!description:
Sets the disabled modifiers These modifiers will not be handled by the <code>ItemNavigation</code>

<pre>
Example: Disable shift + up handling of the <code>ItemNavigation</code>

oItemNavigation.setDisabledModifiers({
    sapnext : ["shift"]
});

Possible keys are : "shift", "alt", "ctrl", "meta"
Possible events are : "sapnext", "sapprevious", "saphome", "sapend"
</pre>

getAccessibilityInfo.!description:
This function (if available on the concrete control) provides the current accessibility state of the control.

Applications must not call this hook method directly, it is called by the framework.

Subclasses of Control should implement this hook to provide any necessary accessibility information:

<pre>
MyControl.prototype.getAccessibilityInfo = function() {
   return {
     role: "textbox",
     type: "date input",
     description: "value",
     focusable: true,
     enabled: true,
     editable: true,
     required: true,
     children: []
   };
};
</pre>

Note: The returned object provides the accessibility state of the control at the point in time when this function is called.

extend.!description:
Defines a new subclass of Control with the name <code>sClassName</code> and enriches it with the information contained in <code>oClassInfo</code>.

<code>oClassInfo</code> can contain the same information that {@link sap.ui.core.Element.extend} already accepts, plus the following <code>renderer</code> property:

Example: <pre>
Control.extend("sap.mylib.MyControl", {
  metadata : {
    library : "sap.mylib",
    properties : {
      text : "string",
      width : "sap.ui.core.CSSSize"
    }
  },
  renderer: {
    apiVersion: 2,
    render: function(oRM, oControl) {
      oRM.openStart("div", oControl);
      oRM.style("width", oControl.getWidth());
      oRM.openEnd();
      oRM.text(oControl.getText());
      oRM.close("div");
    }
  }
});
</pre>

There are multiple ways how a renderer can be specified: <ul> <li>As a <b>plain object</b>: The object will be used to create a new renderer by using {@link sap.ui.core.Renderer.extend} to extend the renderer of the base class of this control. The new renderer will have the same global name as this control class with the additional suffix 'Renderer'.<br> <b>Note:</b> The <code>Renderer.extend</code> method expects a plain object (no prototype chain).</li> <li>As a <b>function</b>: The given function will be used as <code>render</code> function of a new renderer; the renderer will be created in the same way as described for the <i>plain object</i> case.</li> <li>As a <b>ready-made renderer</b>, e.g. imported from the corresponding renderer module. As renderers are simple objects (not instances of a specific class), some heuristic is used to distinguish renderers from the <i>plain object</i> case above: An object is assumed to be a ready-made renderer when it has a <code>render</code> function and either is already exposed under the expected global name or has an <code>extend</code> method.</li> <li>As a <b>fully qualified name</b>: The name will be looked up as a global property. If not defined, a module name will be derived from the global name (dots replaced by slashes), the module will be required and provides the renderer, either as AMD export or via the named global property.</li> <li><b>Omitting the <code>renderer</code> property</b> or setting it to <code>undefined</code>: The fully qualified name of the renderer will be derived from the fully qualified name of the control by adding the suffix "Renderer". The renderer then is retrieved in the same way as described for the <i>fully qualified name</i> case.</li> <li><b><code>null</code> or empty string</b>: The control will have no renderer, a call to <code>oControl.getMetadata().getRenderer()</code> will return <code>undefined</code>.</li> </ul>

If the resulting renderer is incomplete (has no <code>render</code> function) or if it cannot be found at all, rendering of the control will be skipped.

<b>Note:</b> The <code>apiVersion: 2</code> flag is required to enable in-place rendering technology. Before setting this property, please ensure that the constraints documented in section "Contract for Renderer.apiVersion 2" of the {@link sap.ui.core.RenderManager RenderManager} API documentation are fulfilled.

getDefaultUnitPattern.!description:
Returns a default unit format/parse pattern for the given unit short name. The returned pattern can then be used for custom units, for example as a <code>unitPattern-count-other</code> pattern. The <code>unitPattern-count-other</code> pattern is then used by NumberFormat instances as a fallback in case no other patterns are defined, see the below example:

<pre>
var oFormat = NumberFormat.getUnitInstance({
    "customUnits": {
        "myUnit": {
            "unitPattern-count-other": NumberFormat.getDefaultUnitPattern("Bottles"); // returns "{0} Bottles"
        }
    }
});
oFormat.format(1234, "myUnit"); // returns "1.234,00 Bottles"
</pre>

getCurrencyInstance.!description:
Get a currency instance of the NumberFormat, which can be used for formatting.

<p> This instance has HALF_AWAY_FROM_ZERO set as default rounding mode. Please set the roundingMode property in oFormatOptions to change the default value. </p>

The currency instance supports locally defined custom currency exclusive to the created instance. The following example shows how to use custom currencies (e.g. for Bitcoins): <pre>
var oFormat = NumberFormat.getCurrencyInstance({
    "currencyCode": false,
    "customCurrencies": {
        "BTC": {
            "symbol": "\u0243",
            "decimals": 3
        }
    }
});

oFormat.format(123.4567, "BTC"); // " 123.457"
</pre>

As an alternative to using a fixed <code>symbol</code> for your custom currencies, you can also provide an ISO-Code. The provided ISO-Code will be used to look up the currency symbol in the global configuration, either defined in the CLDR or custom defined on the Format Settings (see {@link module:sap/base/i18n/Formatting.setCustomCurrencies Formatting.setCustomCurrencies}, {@link module:sap/base/i18n/Formatting.addCustomCurrencies Formatting.addCustomCurrencies}).

If no symbol is given at all, the custom currency key is used for formatting.

<pre>
var oFormat = NumberFormat.getCurrencyInstance({
    "currencyCode": false,
    "customCurrencies": {
        "MyDollar": {
            "isoCode": "USD",
            "decimals": 3
        },
        "Bitcoin": {
            "decimals": 2
        }
    }
});

// symbol looked up from global configuration
oFormat.format(123.4567, "MyDollar"); // "$123.457"

// no symbol available, custom currency key is rendered
oFormat.format(777.888, "Bitcoin"); // "Bitcoin 777.89"
</pre>

getIntegerInstance.!description:
Get an integer instance of the NumberFormat, which can be used for formatting.

<p> This instance has TOWARDS_ZERO set as default rounding mode. Please set the roundingMode property in oFormatOptions to change the default value. </p>

The following example shows how grouping is done: <pre>
var oFormat = NumberFormat.getIntegerInstance({
    "groupingEnabled": true,  // grouping is enabled
    "groupingSeparator": '.', // grouping separator is '.'
    "groupingSize": 3         // the amount of digits to be grouped (here: thousand)
});

oFormat.format(1234); // "1.234"
</pre>

extend.!description:
Defines a new subclass of ManagedObject with name <code>sClassName</code> and enriches it with the information contained in <code>oClassInfo</code>.

<code>oClassInfo</code> can contain the same information that {@link sap.ui.base.Object.extend} already accepts, plus the following new properties in the 'metadata' object literal (see {@link sap.ui.base.ManagedObject.MetadataOptions MetadataOptions} for details on each of them): <ul> <li><code>library : <i>string</i></code></li> <li><code>properties : <i>object</i></code></li> <li><code>defaultProperty : <i>string</i></code></li> <li><code>aggregations : <i>object</i></code></li> <li><code>defaultAggregation : <i>string</i></code></li> <li><code>associations : <i>object</i></code></li> <li><code>events : <i>object</i></code></li> <li><code>specialSettings : <i>object</i></code> // this one is still experimental and not for public usage!</li> </ul>

Example: <pre>
ManagedObject.extend('sap.mylib.MyClass', {
  metadata : {
    library: 'sap.mylib',
    properties : {
      value: 'string',
      width: 'sap.ui.core.CSSSize',
      height: { type: 'sap.ui.core.CSSSize', defaultValue: '100%'}
      description: { type: 'string', defaultValue: '', selector: '#{id}-desc'}
    },
    defaultProperty : 'value',
    aggregations : {
      header : { type: 'sap.mylib.FancyHeader', multiple : false }
      items : 'sap.ui.core.Control',
      buttons: { type: 'sap.mylib.Button', multiple : true, selector: '#{id} > .sapMLButtonsSection'}
    },
    defaultAggregation : 'items',
    associations : {
      initiallyFocused : { type: 'sap.ui.core.Control' }
    },
    events: {
      beforeOpen : {
        parameters : {
          opener : { type: 'sap.ui.core.Control' }
        }
      }
    },
  },

  init: function() {
  }

}); // end of 'extend' call
</pre>

sap.ui.core.service.Service.!description:
A service provides a specific functionality. A service instance can be obtained by a {@link sap.ui.core.service.ServiceFactory ServiceFactory} or at a Component via {@link sap.ui.core.Component#getService getService} function.

This class is the abstract base class for services and needs to be extended: <pre>
sap.ui.define("my/Service", [
  "sap/ui/core/service/Service"
], function(Service) {

  return Service.extend("my.Service", {

    init: function() {
      // handle init lifecycle
    },

    exit: function() {
      // handle exit lifecycle
    },

    doSomething: function() {
      // some functionality
    }

 });

});
</pre>

A service instance will have a service context: <pre>
{
  "scopeObject": oComponent, // the Component instance
  "scopeType": "component"   // the stereotype of the scopeObject
}
</pre>

The service context can be retrieved with the function <code>getContext</code>. This function is private to the service instance and will not be exposed via the service interface.

For consumers of the service it is recommended to provide the service instance only - as e.g. the {@link sap.ui.core.Component#getService getService} function of the Component does. The service interface can be accessed via the <code>getInterface</code> function.

Other private functions of the service instance are the lifecycle functions. Currently there are two lifecycle functions: <code>init</code> and <code>exit</code>. In addition the <code>destroy</code> function will also by hidden to avoid the control of the service lifecycle for service interface consumers.

