config.!description:
Sets the configuration for the UI5 loader. The configuration can be updated multiple times. Later changes do not impact modules that have been loaded before.

If no parameter is given, a partial copy of UI5 loader configuration in use is returned.

The configuration options are aligned with the "Common Config" draft of the AMD spec (https://github.com/amdjs/amdjs-api/blob/master/CommonConfig.md).

The following code shows an example of what a UI5 loader configuration might look like: <pre>

  sap.ui.loader.config({

    // location from where to load all modules by default
    baseUrl: '../../resources/',

    paths: {
      // load modules whose ID equals to or starts with 'my/module' from example.com
      'my/module': 'https://example.com/resources/my/module'
    },

    map: {
      // if any module requires 'sinon', load module 'sap/ui/thirdparty/sinon-4'
      '*': {
        'sinon': 'sap/ui/thirdparty/sinon-4'
      },
      // but if a module whose ID equals to or starts with 'app' requires 'sinon'
      // then load a legacy version instead
      "app": {
        'sinon': 'sap/ui/legacy/sinon'
      }
    },

    // define two bundles that consists of JS modules only
    bundles: {
      bundle1: ['module1', 'module2'],
      bundle2: ['moduleX', 'moduleY']
    },

    // define a bundle that also contains non-JS resources
    bundlesUI5: {
      'all.js': ['Component.js', 'manifest.json',
                 'App.controller.js', 'App.view.xml']
    },

    // activate real async loading and module definitions
    // (will become obsolete in 2.0 contexts as async will be the only mode there)
    async: true,

    // provide dependency and export metadata for non-UI5 modules
    shim: {
      'sap/ui/thirdparty/blanket': {
        amd: true,
        exports: 'blanket'
      }
    }

  });

</pre>

sap.ui.test.matchers.Ancestor.!description:
Checks if a control has a defined ancestor.

As of version 1.72, it is available as a declarative matcher with the following syntax: <code><pre>{
    ancestor: "object" // where "object" is a declarative matcher for the ancestor
}
</code></pre> The declarative matcher for Ancestor does not support the <b>bDirect</b> parameter.

sap.ui.test.matchers.Ancestor.!helpDescription:
Checks if a control has a defined ancestor.

As of version 1.72, it is available as a declarative matcher with the following syntax: <code><pre>{
    ancestor: "object" // where "object" is a declarative matcher for the ancestor
}
</code></pre> The declarative matcher for Ancestor does not support the <b>bDirect</b> parameter.

setIdSuffix.!description:
Sets a new value for property {@link #getIdSuffix idSuffix}.

Use this only if the target property or the default of the action does not work for your control. The id suffix of the DOM Element the press action will be executed on. For most of the controls you do not have to specify this, since the Control Adapters will find the correct DOM Element. But some controls have multiple DOM elements that could be target of your Action. Then you should set this property. For a detailed documentation of the suffix see {@link sap.ui.core.Element#$}

When called with a value of <code>null</code> or <code>undefined</code>, the default value of the property will be restored.

sap.ui.core.XMLComposite.!constructorDescription:
XMLComposite is the base class for composite controls that use a XML fragment representation
for their visual parts. From a user perspective such controls appear as any other control, but internally the
rendering part is added as a fragment.
The fragment that is used should appear in the same folder as the control's JS implementation with the file extension
<code>.control.xml</code>.
The fragment's content can access the interface data from the XMLComposite control via bindings. Currently only aggregations and properties
can be used with bindings inside a fragment.
The exposed model that is used for internal bindings in the fragment has the default name <code>$this</code>. The name will always start
with an <code>$</code>. The metadata of the derived control can define the alias with its metadata. A code example can be found below.

As XMLComposites compose other controls, they are only invalidated and re-rendered if explicitly defined. Additional metadata
for invalidation can be given for properties and aggregation. The default invalidation is <code>"none"</code>.
Setting invalidate to <code>true</code> for properties and aggregations sets the complete XMLComposite
to invalidate and rerender.</code>

Example:
<pre>
XMLComposite.extend("sap.mylib.MyXMLComposite", {
  metadata : {
    library: "sap.mylib",
    properties : {
      text: { //changing this property will not re-render the XMLComposite
         type: "string",
         defaultValue: ""
      },
      title: { //changing this property will re-render the XMLComposite as it defines invalidate: true
         type: "string",
         defaultValue: "",
         invalidate: true
      },
      value: { //changing this property will re-render the XMLComposite as it defines invalidate: true
         type: "string",
         defaultValue: "",
         invalidate: true
      }
    },
    defaultProperty : "text",
    aggregations : {
      items : {
         type: "sap.ui.core.Control",
         invalidate: true
      },
      header : {
         type: "sap.mylib.FancyHeader",
         multiple : false
      }
    },
    defaultAggregation : "items"
    events: {
      outerEvent : {
        parameters : {
          opener : "sap.ui.core.Control"
        }
      }
    }
  },
  //alias defaults to "this"
  alias: "mycontrolroot" //inner bindings will use model name $mycontrolroot
  //fragment defaults to {control name}.control.xml in this case sap.mylib.MyXMLComposite.control.xml
  fragment: "sap.mylib.MyXMLCompositeOther.control.xml" //the name of the fragment
});
</pre>

Internally the XMLComposite instantiates and initializes the given fragment and stores the resulting control in a hidden
aggregation named <code>_content</code>. The fragment should only include one root element.

Bindings of inner controls to the interface of the XMLComposite can be done with normal binding syntax.
Here properties are used as property bindings and aggregations are used as list bindings.
Currently it is not possible to bind associations in a fragment.

Example:
<pre>
   &lt;core:FragmentDefinition xmlns:m="sap.m" xmlns:core="sap.ui.core"&gt;
      &lt;m:Text text="{$this&gt;text}" visible="{= ${$this&gt;text} !== ""}" /&gt;
   &lt;/core:FragmentDefinition&gt;
</pre>
<pre>
   &lt;core:FragmentDefinition xmlns:m="sap.m" xmlns:core="sap.ui.core"&gt;
      &lt;m:VBox items="{path:"$this&gt;texts", filters:{path:"text", operator:"Contains", value1:"Text"}, sorter:{path:"text", descending:true}}"&gt;
          &lt;m:Text text="{$this&gt;text}" /&gt;
      &lt;/m:VBox&gt;
   &lt;/core:FragmentDefinition&gt;
</pre>
<pre>
   &lt;core:FragmentDefinition xmlns:m="sap.m" xmlns:core="sap.ui.core"&gt;
      &lt;m:Button text="Press Me" press="handlePress"/&gt;
   &lt;/core:FragmentDefinition&gt;
</pre>

All events handled within the fragment will be dispatched to the XMLComposite control. It is recommended to follow this paradigm to allow
reuse of a XMLComposite without any dependency to controller code of the current embedding view.

<pre>
   MyXMLComposite.prototype.handlePress = function() {
       this.fireOuterEvent(); // passing on the event to the outer view
   }
</pre>

<b>Note:</b> {@link topic:b11d853a8e784db6b2d210ef57b0f7d7 Requiring modules in XML} will result in side effects that might cause the XMLComposite to not work properly.
We suggest you require the needed modules inside the JavaScript coding of the class extending the XMLComposite.


Accepts an object literal <code>mSettings</code> that defines initial
property values, aggregated and associated objects as well as event handlers.
See {@link sap.ui.base.ManagedObject#constructor} for a general description of the syntax of the settings object.
</p><p>
The supported settings are:
<ul>
<li>Properties
<ul>
<li>{@link #getWidth width} : sap.ui.core.CSSSize (default: '100%')</li>
<li>{@link #getHeight height} : sap.ui.core.CSSSize</li>
<li>{@link #getDisplayBlock displayBlock} : boolean (default: true)</li>
</ul>
</li>
<li>Aggregations
<ul>
</ul>
</li>
</ul>

In addition, all settings applicable to the base type {@link sap.ui.core.Control#constructor sap.ui.core.Control}
can be used as well.

sap.ui.core.util.XMLPreprocessor.IContex.!description:
Context interface provided by XML template processing as an additional first argument to any formatter function which opts in to this mechanism. Candidates for such formatter functions are all those used in binding expressions which are evaluated during XML template processing, including those used inside template instructions like <code>&lt;template:if></code>. The formatter function needs to be marked with a property <code>requiresIContext = true</code> to express that it requires this extended signature (compared to ordinary formatter functions). The usual arguments are provided after the first one (currently: the raw value from the model).

This interface provides callback functions to access the model and path which are needed to process OData V4 annotations. It initially offers a subset of methods from {@link sap.ui.model.Context} so that formatters might also be called with a context object for convenience, e.g. outside of XML template processing (see below for an exception to this rule).

<b>Example:</b> Suppose you have a formatter function called "foo" like below and it is used within an XML template like <code>&lt;template:if test="{path: '...', formatter: 'foo'}"></code>. In this case <code>foo</code> is called with arguments <code>oInterface, vRawValue</code> such that <code>oInterface.getModel().getObject(oInterface.getPath()) === vRawValue</code> holds. <pre>
window.foo = function (oInterface, vRawValue) {
    //TODO ...
};
window.foo.requiresIContext = true;
</pre>

<b>Composite Binding Examples:</b> Suppose you have the same formatter function and it is used in a composite binding like <code>&lt;Text text="{path: 'Label', formatter: 'foo'}: {path: 'Value', formatter: 'foo'}"/></code>. In this case <code>oInterface.getPath()</code> refers to ".../Label" in the 1st call and ".../Value" in the 2nd call. This means each formatter call knows which part of the composite binding it belongs to and behaves just as if it was an ordinary binding.

Suppose your formatter is not used within a part of the composite binding, but at the root of the composite binding in order to aggregate all parts like <code> &lt;Text text="{parts: [{path: 'Label'}, {path: 'Value'}], formatter: 'foo'}"/></code>. In this case <code>oInterface.getPath(0)</code> refers to ".../Label" and <code>oInterface.getPath(1)</code> refers to ".../Value". This means, the root formatter can access the ith part of the composite binding at will (since 1.31.0); see also {@link #.getInterface getInterface}. The function <code>foo</code> is called with arguments such that <code> oInterface.getModel(i).getObject(oInterface.getPath(i)) === arguments[i + 1]</code> holds.

To distinguish those two use cases, just check whether <code>oInterface.getModel() === undefined</code>, in which case the formatter is called on root level of a composite binding. To find out the number of parts, probe for the smallest non-negative integer where <code>oInterface.getModel(i) === undefined</code>. This additional functionality is, of course, not available from {@link sap.ui.model.Context}, i.e. such formatters MUST be called with an instance of this context interface.

override.!description:
Override the ControllerExtension class with the given custom extension definition.

Only public methods that are not final could be overridden. The lifecycle methods <code>onInit</code>, <code>onExit</code>, <code>onBeforeRendering</code> and <code>onAfterRendering</code> are added before or after the lifecycle functions of the original extension.

Example for <code>oExtension</code>: <pre>
{
    onInit: function() {
        ...
    },
    ...
}
</pre>

<b>Note:</b> This static method is automatically propagated to subclasses of <code>ControllerExtension</code>.

assert.!description:
A map of QUnit-style assertions to be used in an opaTest.

Contains all methods available on <code>QUnit.assert</code> for the running QUnit version. Available assertions are: <code>ok</code>, <code>equal</code>, <code>propEqual</code>, <code>deepEqual</code>, <code>strictEqual</code> and their negative counterparts. You can define custom OPA5 assertions in the extensions section of {@link sap.ui.test.Opa5.extendConfig}.

Example usage: <pre>
  oOpa5.waitFor({
    success: function () {
      Opa5.assert.ok(true, "Should be true");
    }
  });
</pre>

For more information, see {@link module:sap/ui/test/opaQunit}.

sap.ui.core.support.usage.EventBroadcast.!description:
Broadcasts UI5 events via single native custom browser event. This way consumers have a generic mechanism for hooking into any UI5 event. Example consumer code: <pre>
    window.addEventListener("UI5Event", function(oEvent) {

    		// consumer coding, e.g. :
    		// analyze event
    		// store events - GDPR is responsibility of the consumer
    		// or any other

    		var oDetail = oEvent.detail;

    		console.log("UI5 Event " 				+ oDetail.eventName
    			+ " occurred at " 					+ new Date(oDetail.timestamp).toString()
    			+ " for element " 					+ oDetail.targetId
    			+ " of type "						+ oDetail.targetType
    			+ ", which is part of component " 	+ oDetail.componentId
    			+ " with version " 					+ oDetail.componentVersion
    			+ " and additional parameters "		, oDetail.additionalAttributes);

    });
</pre>

setEventsExcludeList.!description:
Sets a new ExcludeList configuration.

ExcludeList configuration should have the following structure as in the example shown below.

In <code>global</code> object, we set all events that we don't want to track. In <code>controls</code> object, we can list different controls and include or exclude events for them.

For example, in this configuration the <code>load</code> event is exposed for the <code>sap.m.Image</code> control regardless of it being excluded globally for all other controls.

For <code>sap.m.Button</code> control, we don't want to track the <code>tap</code> event but we need to track the <code>afterRendering</code> event.

In the case where we write in the <code>controls</code> object a control without any excluded or included events, this control is NOT tracked at all.

In the example configuration events coming from control <code>sap.m.AccButton</code> are not be exposed.

<pre>
{
		global: ["modelContextChange", "beforeRendering", "afterRendering",
				"propertyChanged", "beforeGeometryChanged", "geometryChanged",
				"aggregationChanged", "componentCreated", "afterInit",
				"updateStarted", "updateFinished", "load", "scroll"
				],
		controls: {
			"sap.m.Image": {
				include: ["load"]
			},
			"sap.m.Button": {
				exclude: ["tap"],
				include: ["afterRendering"]
			},
			"sap.m.AccButton": {}
		}
	}
</pre> The set configuration object is copied from the given one.

