sap.ui.core.Fragment.!description:
Fragments support the definition of light-weight stand-alone UI control trees. This class acts as factory which returns the UI control tree defined inside the Fragments. When used within declarative Views, the Fragment content is imported and seamlessly integrated into the View.

Fragments are used similar as sap.ui.core.mvc.Views, but Fragments do not have a Controller on their own (they may know one, though), they are not a Control, they are not part of the UI tree and they have no representation in HTML. By default, in contrast to declarative Views, they do not do anything to guarantee ID uniqueness.

But like Views they can be defined in several Formats (XML and JavaScript; support for other types can be plugged in), the declaration syntax is the same as in declarative Views and the name and location of the Fragment files is similar to Views. Controller methods can also be referenced in the declarations, but as Fragments do not have their own controllers, this requires the Fragments to be used within a View which does have a controller. That controller is used, then.

A JS Fragment can be defined in a dedicated module named "*.fragment.js". This module must return an object with a <code>createContent</code> method which has to return a control. JS Fragments are also capable of asynchronously creating content. To do so, the <code>createContent</code> function must return a Promise resolving with the content controls.

<b>Example:</b> Defining a JS Fragment <pre>
// e.g. module "my/sample/Button.fragment.js"
sap.ui.define(["sap/m/Button"], function(Button) {
 return {
   createContent: (oController) => {
     const oButton  = new Button({
       text: "Hello World" ,
       press: oController.doSomething
     });
     return oButton;
   }
 };
});
</pre>

<b>Example:</b> Defining a JS Fragment with a async 'createContent' method <pre>
// e.g. module "my/sample/AsyncButton.fragment.js"
sap.ui.define(["sap/m/Button", "sap/base/i18n/ResourceBundle"], function(Button, ResourceBundle) {
 return {
   createContent: async (oController) => {
     // loading a resource bundle async to retrieve button text
     const myBundle  = await ResourceBundle.create({ bundleName: "...", async: true });
     return new Button({ text: myBundle.getText("...") });
   }
 };
});
</pre>

Fragments can be instantiated with {@link sap.ui.core.Fragment.load Fragment.load} or the {@link sap.ui.core.mvc.Controller.loadFragment loadFragment} function from a controller.

Do not call the Fragment constructor directly!

Use-cases for Fragments are e.g.: - Modularization of UIs without fragmenting the controller structure - Re-use of UI parts - 100%-declarative definition of Views

