sap.ui.core.mvc.View.!description:
A base class for Views.

Introduces the relationship to a Controller, some basic visual appearance settings like width and height, and provides lifecycle events.

Views form an ID scope for the elements and controls in their content. They can prefix the IDs of elements either automatically (e.g. XMLView) or programmatically (using {@link #createId}). With method {@link #byId}, elements or controls can be found with their view-local ID. Also see {@link topic:91f28be26f4d1014b6dd926db0e91070 "Support for Unique IDs"} in the documentation.

<h3>View Definition</h3> A view can be defined by {@link sap.ui.core.mvc.View.extend extending} this class and implementing the {@link #createContent} method. The method must return one or many root controls that will be rendered as content of the view.

Views that are defined that way are referred to as <b>typed views</b>, as each view definition is represented by its own class (type). See {@link topic:e6bb33d076dc4f23be50c082c271b9f0 Typed Views} for further information.

<b>Example:</b> Defining a typed view (module 'myapp/views/MainView.js') <pre>
  // view definition
  sap.ui.define([
    "sap/ui/core/mvc/View",
    "sap/m/Panel"
  ], function(View, Panel) {

    return View.extend("myapp.views.MainView", {

      // define, which controller to use
      getControllerName: function() {
        return "myapp.controller.Main";
      },

      // whether the ID of content controls should be prefixed automatically with the view's ID
      getAutoPrefixId: function() {
        return true; // default is false
      }

      // create view content and return the root control(s)
      // or a Promise resolving with the control(s).
      createContent: function() {
        return new Promise(function(res, rej) {
            res(new Panel({...}));
        }).catch(function(err) {
            rej(err);
        });
      }
    });
  });
</pre>

<h3>View Instantiation</h3> The preferred way of instantiating a typed view is via the generic factory {@link sap.ui.core.mvc.View.create View.create}.

When the <code>viewName</code> starts with prefix <code>"module:"</code>, the remainder of the name is assumed to be the name of a module that exports a typed view (a subclass of <code>View</code>). The module name must use the same syntax as for <code>sap.ui.define/sap.ui.require</code> (slash-separated name without '.js' suffix).

<b>Example:</b> Instantiating a typed view with <code>View.create</code> <pre>
  View.create({
    viewName: "module:myapp/views/MainView"
  }).then(oView) {
    oView.placeAt("content");
  });
</pre>

A typed view can also be instantiated by calling its constructor without any arguments: <pre>
  sap.ui.require(["myapp/views/MainView"], function(MainView) {
    new MainView().placeAt("content");
  });
</pre>

<h3>Other Methods</h3> Besides <code>createContent</code>, there are other methods that a view can implement: <ul> <li>Method {@link #getControllerName getControllerName} defines the name of the controller that should be instantiated and used for the view. The name must be in class name notation (dot notation), without the <code>".controller"</code> suffix. The suffix will be added by the framework when loading the module containing the controller.</li> <li>Method {@link #getControllerModuleName getControllerModuleName} defines the module name of the controller that should be loaded for the view. Unlike <code>getControllerName</code>, the name must be in <code>sap.ui.define/sap.ui.require</code> syntax (slash-separated name without '.js' suffix).</li> <li>{@link #getAutoPrefixId getAutoPrefixId} defines whether the IDs of controls created during the execution of <code>createContent</code> will be prefixed with the ID of the view automatically. The default implementation of this method returns <code>false</code>.</li> </ul>

