invalidate.!description:
Invalidate the model data.

Mark all entries in the model cache as invalid. Next time a context or list is bound (binding), the respective entries will be detected as invalid and will be refreshed from the server.

To refresh all model data use {@link sap.ui.model.odata.v2.ODataModel#refresh}

extendConfig.!description:
Extends and overwrites default values of the {@link sap.ui.test.Opa.Config}. Most frequent usecase: <pre>
    <code>
        // Every waitFor will append this namespace in front of your viewName
        Opa5.extendConfig({
           viewNamespace: "namespace.of.my.views."
        });

        var oOpa = new Opa5();

        // Looks for a control with the id "myButton" in a View with the name "namespace.of.my.views.Detail"
        oOpa.waitFor({
             id: "myButton",
             viewName: "Detail"
        });

        // Looks for a control with the id "myList" in a View with the name "namespace.of.my.views.Master"
        oOpa.waitFor({
             id: "myList",
             viewName: "Master"
        });
    </code>
</pre>

Sample usage: <pre>
    <code>
        var oOpa = new Opa5();

        // this statement will  will time out after 15 seconds and poll every 400ms.
        // those two values come from the defaults of {@link sap.ui.test.Opa.config}.
        oOpa.waitFor({
        });

        // All wait for statements added after this will take other defaults
        Opa5.extendConfig({
            timeout: 10,
            pollingInterval: 100
        });

        // this statement will time out after 10 seconds and poll every 100 ms
        oOpa.waitFor({
        });

        // this statement will time out after 20 seconds and poll every 100 ms
        oOpa.waitFor({
            timeout: 20;
        });
    </code>
</pre>

sap.ui.test.matchers.AggregationContains.!description:
Checks if an aggregation contains at least one item that has a property set to a certain value.

As of version 1.72, it is available as a declarative matcher with the following syntax: <pre><code>{
    aggregationContainsPropertyEqual: {
        aggregationName: "string",
        propertyName: "string",
        propertyValue: "string"
    }
}
</code></pre>

sap.ui.test.matchers.AggregationContains.!helpDescription:
Checks if an aggregation contains at least one item that has a property set to a certain value.

As of version 1.72, it is available as a declarative matcher with the following syntax: <pre><code>{
    aggregationContainsPropertyEqual: {
        aggregationName: "string",
        propertyName: "string",
        propertyValue: "string"
    }
}
</code></pre>

createType.!description:
Derives a new type from a given base type.

Example:<br> <pre>

  var fooType = DataType.createType('foo', {
      isValid : function(vValue) {
          return /^(foo(bar)?)$/.test(vValue);
      }
  }, DataType.getType('string'));

  fooType.isValid('foo'); // true
  fooType.isValid('foobar'); // true
  fooType.isValid('==foobar=='); // false

</pre>

If <code>mSettings</code> contains an implementation for <code>isValid</code>, then the validity check of the newly created type will first execute the check of the base type and then call the given <code>isValid</code> function.

Array types and enumeration types cannot be created with this method. They're created on-the-fly by {@link #.getType DataType.getType} when such a type is looked up.

<b>Note:</b> The creation of new primitive types is not supported. When a type is created without a base type, it is automatically derived from the primitive type <code>any</code>.

<b>Note:</b> If a type has to be used in classes, then the implementation of <code>isValid</code> must exactly have the structure shown in the example above (single return statement, regular expression literal of the form <code>/^(...)$/</code>, calling <code>/regex/.test()</code> on the given value). Only the inner part of the regular expression literal can be different.

registerEnum.!description:
Registers an enum under the given name. With version 2.0, registering an enum becomes mandatory when said enum is to be used in properties of a {@link sap.ui.base.ManagedObject ManagedObject} subclass.

Example:<br> <pre>
   DataType.registerEnum("my.enums.Sample", {
      "A": "A",
      "B": "B",
      ...
   });
</pre>

onUIComponentInstanceDestroy.!description:
Callback handler which will be executed when a Component instance is destroyed.

Example usage: <pre>
sap.ui.require(['sap/ui/core/UIComponent'], function(UIComponent) {
  ComponentHooks.onUIComponentInstanceDestroy.register(function(oComponent) {
    // do some logic with the Component
  });
});
</pre>

<b>ATTENTION:</b> This hook must only be used by Fiori 2.0 adapter.

onUIComponentInstanceInitialized.!description:
Callback handler which will be executed once a new Component instance is initialized.

Example usage: <pre>
sap.ui.require(['sap/ui/core/ComponentHooks'], function(ComponentHooks) {
  ComponentHooks.onUIComponentInstanceInitialized.register(function(oComponent) {
    // do some logic with the Component
  });
});
</pre>

<b>ATTENTION:</b> This hook must only be used by Fiori 2.0 adapter.

onComponentLoaded.!description:
Callback handler which will be executed once the component is loaded. A copy of the configuration object together with a copy of the manifest object will be passed into the registered function. Also a return value is not expected from the callback handler. It will only be called for asynchronous manifest first scenarios. <p> Example usage: <pre>
sap.ui.require(['sap/ui/core/ComponentHooks'], function(ComponentHooks) {
  ComponentHooks.onComponentLoaded.register(function(oConfig, oManifest) {
    // do some logic with the config
  });
});
</pre> <p> <b>ATTENTION:</b> This hook must only be used by UI flexibility (library: sap.ui.fl) and will be replaced with a more generic solution!

onModelCreated.!description:
Callback handler that executes when a manifest model (ODataModel v2 and v4) is created. The registered function receives an object containing: <ul> <li>Model instance</li> <li>Manifest object</li> <li>Manifest model ID</li> <li>Owner component ID (if available)</li> <li>Configuration object from the component factory</li> </ul>

Example usage: <pre>
sap.ui.require(['sap/ui/core/ComponentHooks'], function(ComponentHooks) {
  ComponentHooks.onModelCreated.register(function(oInfo) {
    // do some logic
  });
});
</pre>

onInstanceCreated.!description:
Callback handler which will be executed once a component instance has been created by {#link sap.ui.component}. The component instance and the configuration object will be passed into the registered function. For async scenarios (<code>vConfig.async = true</code>) a Promise can be provided as return value from the callback handler to delay resolving the Promise returned by {@link sap.ui.component}. In synchronous scenarios the return value will be ignored.

Example usage: <pre>
sap.ui.require(['sap/ui/core/ComponentHooks'], function(ComponentHooks) {
  ComponentHooks.onInstanceCreated.register(function(oComponent, oConfig) {
    // do some logic with the config

    // optionally return a Promise
    return doAsyncStuff();
  });
});
</pre> <b>ATTENTION:</b> This hook must only be used by UI flexibility (sap.ui.fl) or the sap.ui.integration library.

CustomStyleClassSupport.!description:
Applies the support for custom style classes on the prototype of a <code>sap.ui.core.Element</code>.

All controls (subclasses of <code>sap.ui.core.Control</code>) provide the support custom style classes. The control API provides functions to the application which allow it to add, remove or change style classes for the control. In general, this option is not available for elements because elements do not necessarily have a representation in the DOM.

This function can be used by a control developer to explicitly enrich the API of his/her element implementation with the API functions for the custom style class support. It must be called on the prototype of the element.

<b>Usage Example:</b> <pre>
sap.ui.define(['sap/ui/core/Element', 'sap/ui/core/CustomStyleClassSupport'], function(Element, CustomStyleClassSupport) {
   "use strict";
   var MyElement = Element.extend("my.MyElement", {
      metadata : {
         //...
      }
      //...
   });

   CustomStyleClassSupport.apply(MyElement.prototype);

   return MyElement;
}, true);
</pre>

The classes are written to the HTML automatically when using the {@link sap.ui.core.RenderManager Semantic Rendering API}. To ensure that the classes are written to the HTML with the traditional string-based rendering, when writing the root tag of the element you must call the function <code>oRenderManager.writeClasses(oElement);</code> ({@link sap.ui.core.RenderManager#writeClasses}) within the renderer of the control to which the element belongs.

This function adds the following functions to the elements prototype: <ul> <li><code>addStyleClass</code>: {@link sap.ui.core.Control#addStyleClass}</li> <li><code>removeStyleClass</code>: {@link sap.ui.core.Control#removeStyleClass}</li> <li><code>toggleStyleClass</code>: {@link sap.ui.core.Control#toggleStyleClass}</li> <li><code>hasStyleClass</code>: {@link sap.ui.core.Control#hasStyleClass}</li> </ul> In addition the clone function of the element is extended to ensure that the custom style classes are also available on the cloned element.

<b>Note:</b> This function can only be used <i>within</i> control development. An application cannot add style class support on existing elements by calling this function.

ContextMenuSupport.!description:
Applies the support for custom ContextMenu on the prototype of a <code>sap.ui.core.Control</code>.

This function can be used by a control developer to explicitly enrich the API of his/her element implementation with the API functions for the custom contextMenu support.

<b>Usage Example:</b> <pre>
sap.ui.define(['sap/ui/core/Element', 'sap/ui/core/ContextMenuSupport'], function(Element, ContextMenuSupport) {
   "use strict";
   var MyControl = Control.extend("my.MyControl", {
      metadata : {
         //...
      }
      //...
   });

   ContextMenuSupport.apply(MyControl.prototype);

   return MyControl;
}, true);
</pre>

This function adds the following function to the elements prototype: <ul> <li><code>setContextMenu</code></li> <li><code>getContextMenu</code></li> </ul>

<b>Note:</b> This function can only be used <i>within</i> control development. An application cannot add context menu support for instances of controls.

registerExtensionProvider.!description:
Registers a callback module, which provides code enhancements for the lifecycle and event handler functions of a specific controller. The code enhancements are returned either in sync or async mode.

The extension provider module provides the <code>getControllerExtensions</code> function which returns either directly an array of objects or a Promise that returns an array of objects when it resolves. These objects are object literals defining the methods and properties of the controller in a similar way as for {@link sap.ui.core.mvc.Controller Controller} subclasses.

<b>Example for a callback module definition (sync):</b> <pre>
sap.ui.define("my/custom/sync/ExtensionProvider", [], function() {
  var ExtensionProvider = function() {};
  ExtensionProvider.prototype.getControllerExtensions = function(sControllerName, sComponentId, bAsync) {
    if (!bAsync && sControllerName == "my.own.Controller") {
      // IMPORTANT: only return extensions for a specific controller
      return [{
        onInit: function() {
          // Do something here...
        },
        onAfterRendering: function() {
          // Do something here...
        },
        onButtonClick: function(oEvent) {
          // Handle the button click event
        }
      }
    }];
  };
  return ExtensionProvider;
});
</pre>

<b>Example for a callback module definition (async):</b> <pre>
sap.ui.define("my/custom/async/ExtensionProvider", [], function() {
  var ExtensionProvider = function() {};
  ExtensionProvider.prototype.getControllerExtensions = function(sControllerName, sComponentId, bAsync) {
    if (bAsync && sControllerName == "my.own.Controller") {
      // IMPORTANT:
      // only return a Promise for a specific controller since it
      // requires the View/Controller and its parents to run in async
      // mode!
      return new Promise(function(fnResolve, fnReject) {
        fnResolve([{
          onInit: function() {
            // Do something here...
          },
          onAfterRendering: function() {
            // Do something here...
          },
          onButtonClick: function(oEvent) {
            // Handle the button click event
          }
        }]);
      }
    };
  };
  return ExtensionProvider;
});
</pre>

The lifecycle functions <code>onInit</code>, <code>onExit</code>, <code>onBeforeRendering</code> and <code>onAfterRendering</code> are added before or after the lifecycle functions of the original controller. The event handler functions, such as <code>onButtonClick</code>, are replacing the original controller's function.

When using an async extension provider, you need to ensure that the view is loaded in async mode.

In both cases, return <code>undefined</code> if no controller extension shall be applied.

cleanupControlWithoutRendering.!description:
Cleans up the rendering state of the given control without rendering it.

A control is responsible for the rendering of all its child controls. But in some cases it makes sense that a control only renders a subset of its children based on some criterion. For example, a typical carousel control might, for performance reasons, only render the currently visible children (and maybe some child before and after the visible area to facilitate slide-in / slide-out animations), but not all children. This leads to situations where a child had been rendered before, but shouldn't be rendered anymore after an update of the carousel's position. The DOM related state of that child then must be cleaned up correctly, e.g. by de-registering resize handlers or native event handlers. <code>cleanupControlWithoutRendering</code> helps with that task by triggering the same activities that the normal rendering triggers before the rendering of a control (e.g. it fires the <code>BeforeRendering</code> event). It just doesn't call the renderer and the control will not receive an <code>AfterRendering</code> event.

The following example shows how <code>renderControl</code> and <code>cleanupControlWithoutRendering</code> should be used:

<pre>
  CarouselRenderer.render = function(rm, oCarousel){

    ...

    oCarousel.getPages().forEach( function( oPage ) {
       if ( oCarousel.isPageToBeRendered( oPage ) ) {
          rm.renderControl( oPage ); // onBeforeRendering, render, later onAfterRendering
       } else {
          rm.cleanupControlWithoutRendering( oPage ); // onBeforeRendering
       }
    });

    ...

  };
</pre>

<h3>DOM Removal</h3> The method does not remove the DOM of the given control. The caller of this method has to take care to remove it at some later point in time. It should indeed be <i>later</i>, not <i>before</i> as the <code>onBeforeRendering</code> hook of the control might need access to the old DOM for a proper cleanup.

For parents which are rendered with the normal mechanism as shown in the example above, the removal of the old child DOM is guaranteed. The whole DOM of the parent control (including the DOM of the no longer rendered child) will be replaced with new DOM (no longer containing the child) when the rendering cycle finishes.

<b>Note:</b>: the functionality of this method is different from the default handling for invisible controls (controls with <code>visible == false</code>). The standard rendering for invisible controls still renders a placeholder DOM. This allows rerendering of the invisible control once it becomes visible again without a need to render its parent, too. Children that are cleaned up with this method here, are supposed to have no more DOM at all. Rendering them later on therefore requires an involvement (typically: a rendering) of their parent.

flush.!description:
Renders the content of the rendering buffer into the provided DOM node.

This function must not be called within control renderers.

Usage: <pre>

  // Create a new instance of the RenderManager
  var rm = sap.ui.getCore().createRenderManager();

  // Use the writer API to fill the buffers
  rm.write(...);
  rm.renderControl(oControl);
  rm.write(...);
  ...

  // Finally flush the buffer into the provided DOM node (The current content is removed)
  rm.flush(oDomNode);

  // If the instance is not needed anymore, destroy it
  rm.destroy();

</pre>

sap.ui.core.RenderManager.!description:
A class that handles the rendering of controls.

For the default rendering task of UI5, a shared RenderManager is created and owned by <code>sap.ui.core.Core</code>. Controls or other code that want to render controls outside the default rendering task can create a private instance of RenderManager by calling the {@link sap.ui.core.Core#createRenderManager sap.ui.getCore().createRenderManager()} method. When such a private instance is no longer needed, it should be {@link #destroy destroyed}.

Control renderers only have access to a subset of the public and protected instance methods of this class. The instance methods {@link #flush}, {@link #render} and {@link #destroy} are not part of that subset and are reserved to the owner of the corresponding RenderManager instance. Renderers will use the provided methods to create their HTML output. The RenderManager will collect the HTML output and inject the final HTML DOM at the desired location.

<h3>Renderers</h3> When the {@link #renderControl} method of the RenderManager is invoked, it will retrieve the default renderer for that control. By convention, the default renderer is implemented in its own namespace (static class) which matches the name of the control's class with the additional suffix 'Renderer'. So for a control <code>sap.m.Input</code> the default renderer will be searched for under the global name <code>sap.m.Input<i>Renderer</i></code>.

<h3>Semantic Rendering</h3> As of 1.67, <code>RenderManager</code> provides a set of new APIs to describe the structure of the DOM that can be used by the control renderers.

<pre>

  myButtonRenderer.render = function(rm, oButton) {

      rm.openStart("button", oButton);
      rm.attr("tabindex", 1);
      rm.class("myButton");
      rm.style("width", oButton.getWidth());
      rm.openEnd();
          rm.text(oButton.getText());
      rm.close("button");

  };

</pre>

By default, when the control is invalidated (e.g. a property is changed, an aggregation is removed, or an association is added), it will be registered for rerendering. During the (re)rendering, the <code>render</code> method of the control renderer is executed via a specified <code>RenderManager</code> interface and the control instance.

Traditional string-based rendering creates a new HTML structure of the control in every rendering cycle and removes the existing control DOM structure from the DOM tree.

The set of new semantic <code>RenderManager</code> APIs lets us understand the structure of the DOM, walk along the live DOM tree, and figure out changes as new APIs are called. If there is a change, then <code>RenderManager</code> patches only the required parts of the live DOM tree. This allows control developers to remove their DOM-related custom setters.

<b>Note:</b> To enable the new in-place rendering technology, the <code>apiVersion</code> property of the control renderer must be set to <code>2</code>. This property is not inherited by subclass renderers. It has to be set anew by each subclass to assure that the extended contract between framework and renderer is fulfilled (see next paragraph).

<pre>

  var myButtonRenderer = {
      apiVersion: 2    // enable semantic rendering
  };

  myButtonRenderer.render = function(rm, oButton) {

      rm.openStart("button", oButton);
      ...
      ...
      rm.close("button");

  };

</pre>

<h3>Contract for Renderer.apiVersion 2</h3> To allow a more efficient in-place DOM patching and to ensure the compatibility of the control, the following prerequisites must be fulfilled for the controls using the new rendering technology:

<ul> <li>Legacy control renderers must be migrated to the new semantic renderer API: {@link sap.ui.core.RenderManager#openStart openStart}, {@link sap.ui.core.RenderManager#voidStart voidStart}, {@link sap.ui.core.RenderManager#style style}, {@link sap.ui.core.RenderManager#class class}, {@link sap.ui.core.RenderManager#attr attr}, {@link sap.ui.core.RenderManager#openEnd openEnd}, {@link sap.ui.core.RenderManager#voidEnd voidEnd}, {@link sap.ui.core.RenderManager#text text}, {@link sap.ui.core.RenderManager#unsafeHtml unsafeHtml}, {@link sap.ui.core.RenderManager#icon icon}, {@link sap.ui.core.RenderManager#accessibilityState accessibilityState}, {@link sap.ui.core.RenderManager#renderControl renderControl}, {@link sap.ui.core.RenderManager#cleanupControlWithoutRendering cleanupControlWithoutRendering} </li> <li>During the migration, restrictions that are defined in the API documentation of those methods must be taken into account, e.g. tag and attribute names must be set in their canonical form.</li> <li>Fault tolerance of HTML5 markup is not applicable for the new semantic rendering API, e.g. except void tags, all tags must be closed; duplicate attributes within one HTML element must not exist.</li> <li>Existing control DOM structure will not be removed from the DOM tree; therefore all custom events, including the ones that are registered with jQuery, must be de-registered correctly at the <code>onBeforeRendering</code> and <code>exit</code> hooks.</li> <li>Classes and attribute names must not be escaped.</li> <li>Styles should be validated via types (e.g. <code>sap.ui.core.CSSSize</code>). But this might not be sufficient in all cases, e.g. validated URL values can contain harmful content; in this case {@link module:sap/base/security/encodeCSS encodeCSS} can be used.</li> <li>To allow a more efficient DOM update, second parameter of the {@link sap.ui.core.RenderManager#openStart openStart} or {@link sap.ui.core.RenderManager#voidStart voidStart} methods must be used to identify elements, e.g. use <code>rm.openStart("div", oControl.getId() + "-suffix");</code> instead of <code>rm.openStart("div").attr("id", oControl.getId() + "-suffix");</code></li> <li>Controls that listen to the <code>focusin</code> event must double check their focus handling. Since DOM nodes are not removed and only reused, the <code>focusin</code> event might not be fired during rerendering.</li> </ul>

<h3>Contract for Renderer.apiVersion 4</h3> The <code>apiVersion 4</code> marker of the control renderer lets the <code>RenderManager</code> know if a control's output is not affected by changes in the parent control. By default, if a property, an aggregation, or an association of a control is changed, then the control gets invalidated, and the rerendering process for that control and all of its children starts. That means child controls rerender together with their parent even though there is no DOM update necessary. If a control's output is only affected by its own properties, aggregations, or associations, then the <code>apiVersion 4</code> marker can help to reuse the control's DOM output and prevent child controls from rerendering unnecessarily while they are getting rendered by their parent. This can help to improve performance by reducing the number of re-renderings.<br> For example: A control called "ParentControl" has a child control called "ChildControl". ChildControl has its own properties, aggregations, and associations, and its output is only affected by them. The <code>apiVersion 4</code> marker is set in the renderer of ChildControl. Whenever a property of the ParentControl is changed during the re-rendering process, the <code>RenderManager</code> will check the <code>apiVersion</code> marker of the ChildControl's renderer, and if it's 4, the <code>RenderManager</code> will skip rendering of the ChildControl.<br>

To allow a more efficient rerendering with an <code>apiVersion 4</code> marker, the following prerequisites must be fulfilled for the control to ensure compatibility:

<ul> <li>All the prerequisites of the <code>apiVersion 2</code> marker must be fulfilled by the control.</li> <li>The behavior and rendering logic of the control must not rely on the assumption that it will always be re-rendered at the same time as its parent.</li> <li>The <code>onBeforeRendering</code> and <code>onAfterRendering</code> hooks of the control must not be used to manipulate or access any elements outside of the control's own DOM structure.</li> <li>The control renderer must maintain a proper rendering encapsulation and render only the properties, aggregations, and associations that are specific to the control. The renderer should not reference or depend on any state of the parent control or any other external element.</li> <li>If certain aggregations are dependent on the state of the parent control, they must always be rendered together with their parent. To accomplish this, the parent control must use the {@link sap.ui.core.Control#invalidate invalidate} method to signal to the child controls that they need to re-render whenever the dependent state of the parent control changes. This guarantees that the child controls are always in sync with the parent control, regardless of the <code>apiVersion</code> definition of their renderer.</li> </ul><br>

<b>Note:</b> The rendering can only be skipped if the renderer of each descendant control has the <code>apiVersion 4</code> marker, and no <code>onBeforeRendering</code> or <code>onAfterRendering</code> event delegates are registered. However, while {@link sap.ui.core.Element#addEventDelegate adding the event delegate}, setting the <code>canSkipRendering</code> property to <code>true</code> on the event delegate object can be done to indicate that those delegate handlers are compliant with the <code>apiVersion:4</code> prerequisites and still allows for rendering optimization.<br> The <code>canSkipRendering</code> property can also be used for the controls that enhance the accessibility state of child controls with implementing the {@link sap.ui.core.Element#enhanceAccessibilityState enhanceAccessibilityState} method. In this case, setting the <code>canSkipRendering</code> property to <code>true</code> lets the <code>RenderManager</code> know that the parent control's accessibility enhancement is static and does not interfere with the child control's rendering optimization.

