extend.!description:
Defines a new subclass of ManagedObject with name <code>sClassName</code> and enriches it with the information contained in <code>oClassInfo</code>.

<code>oClassInfo</code> can contain the same information that {@link sap.ui.base.Object.extend} already accepts, plus the following new properties in the 'metadata' object literal (see {@link sap.ui.base.ManagedObject.MetadataOptions MetadataOptions} for details on each of them): <ul> <li><code>library : <i>string</i></code></li> <li><code>properties : <i>object</i></code></li> <li><code>defaultProperty : <i>string</i></code></li> <li><code>aggregations : <i>object</i></code></li> <li><code>defaultAggregation : <i>string</i></code></li> <li><code>associations : <i>object</i></code></li> <li><code>events : <i>object</i></code></li> <li><code>specialSettings : <i>object</i></code> // this one is still experimental and not for public usage!</li> </ul>

Example: <pre>
ManagedObject.extend('sap.mylib.MyClass', {
  metadata : {
    library: 'sap.mylib',
    properties : {
      value: 'string',
      width: 'sap.ui.core.CSSSize',
      height: { type: 'sap.ui.core.CSSSize', defaultValue: '100%'}
      description: { type: 'string', defaultValue: '', selector: '#{id}-desc'}
    },
    defaultProperty : 'value',
    aggregations : {
      header : { type: 'sap.mylib.FancyHeader', multiple : false }
      items : 'sap.ui.core.Control',
      buttons: { type: 'sap.mylib.Button', multiple : true, selector: '#{id} > .sapMLButtonsSection'}
    },
    defaultAggregation : 'items',
    associations : {
      initiallyFocused : { type: 'sap.ui.core.Control' }
    },
    events: {
      beforeOpen : {
