sap.ui.test.matchers.BindingPath.!description:
Checks if a control has a binding context with the exact same binding path.

As of version 1.60, comparison is strict and can include one or more binding criteria: <ul> <li>context path (matches children of bound controls, eg: items in a table)</li> <li>property path (matches controls with no context and a single bound property, eg: Text with binding for property text)</li> <li>context path + property path (matches children of bound controls, where the child has a binding for a certain property within the context)</li> <li>as of version 1.86, static value is also accepted. Use this only for {@link sap.ui.model.StaticBinding} </li> </ul>

<b>Note:</b> Before version 1.60, the only available criteria is binding context path.

As of version 1.72, it is available as a declarative matcher with the following syntax: <code><pre>{
    bindingPath: {
        path: "string",
        modelName: "string",
        propertyPath: "string"
    }
}
</code></pre> As of version 1.81, you can use regular expressions in declarative syntax: <code><pre>{
    bindingPath: {
        path: {
            regex: {
                source: "binding.*PathValue$",
                flags: "ig"
            }
        }
    }
}
</code></pre>

