sap.ui.core.Core.!description:
Singleton Core instance of the SAP UI Library.

The module export of <code>sap/ui/core/Core</code> is <b>not</b> a class, but the singleton Core instance itself. The <code>sap.ui.core.Core</code> class itself must not be instantiated, except by the framework itself.

The Core provides a {@link #ready ready function} to execute code after the Core was booted.

Example: <pre>

  sap.ui.require(["sap/ui/core/Core"], async function(Core) {

    // Usage of a callback function
    Core.ready(function() {
      ...
    });

    // Usage of Core.ready() as a Promise
    await Core.ready();
    ...
  });

</pre>

