extend.!description:
Defines a new subclass of WebComponent with the name <code>sClassName</code> and enriches it with the information contained in <code>oClassInfo</code>.

<code>oClassInfo</code> can contain the same information that {@link sap.ui.base.ManagedObject.extend} already accepts, plus the <code>dnd</code> property in the metadata object literal to configure drag-and-drop behavior (see {@link sap.ui.core.webc.WebComponent.MetadataOptions MetadataOptions} for details). Objects describing aggregations can also have a <code>dnd</code> property when used for a class extending <code>WebComponent</code> (see {@link sap.ui.base.ManagedObject.MetadataOptions.AggregationDnD AggregationDnD}).

Example: <pre>
WebComponent.extend('sap.mylib.MyElement', {
  metadata : {
    library : 'sap.mylib',
    tag : 'my-webcomponent',
    properties : {
      value : 'string',
      width : {
        type: 'sap.ui.core.CSSSize',
        mapping: 'style'
      }
    },
    defaultAggregation: "content",
    aggregations : {
      content : {
        type: 'sap.ui.core.Control',
        multiple : true
      },
      header : {
        type : 'sap.ui.core.Control',
        multiple : false,
        slot: 'header'
      }
    }
  }
});
</pre>

parameters.oParameters:
type: object, description: The parameters for the route. As of Version 1.75 the recommendation is naming the query parameter with a leading "?" character, which is identical to the definition in the route's pattern. The old syntax without a leading "?" character is deprecated. e.g. <b>Route:</b> <code>{parameterName1}/:parameterName2:/{?queryParameterName}</code> <b>Parameter:</b> <pre>
				{
					parameterName1: "parameterValue1",
					parameterName2: "parameterValue2",
					"?queryParameterName": {
						queryParameterName1: "queryParameterValue1"
					}
				}
				</pre>

sap.ui.test.matchers.LabelFor.!description:
The LabelFor matcher checks if a given control has a label associated with it. For every Label on the page, the matcher checks if: <ul> <li> its labelFor association is to the given control </li> <li> its properties match a condition </li> </ul> Labels can be matched by: <ul> <li> text </li> <li> i18n key, modelName, parameters or propertyName. See {@link sap.ui.test.matchers.I18NText} </li> <li> combination of text and key is not possible </li> </ul> Some control types cannot be in a labelFor association: <ul> <li> sap.ui.comp.navpopover.SmartLink </li> <li> sap.m.Link </li> <li> sap.m.Label </li> <li> sap.m.Text </li> </ul>

As of version 1.72, it is available as a declarative matcher with the following syntax: <code><pre>{
    labelFor: {
        text: "string",
        modelName: "string",
        key: "string",
        parameters: "any",
        propertyName: "string"
    }
}
</code></pre>

