extend.!description:
Defines a new subclass of Element with the name <code>sClassName</code> and enriches it with the information contained in <code>oClassInfo</code>.

<code>oClassInfo</code> can contain the same information that {@link sap.ui.base.ManagedObject.extend} already accepts, plus the <code>dnd</code> property in the metadata object literal to configure drag-and-drop behavior (see {@link sap.ui.core.Element.MetadataOptions MetadataOptions} for details). Objects describing aggregations can also have a <code>dnd</code> property when used for a class extending <code>Element</code> (see {@link sap.ui.base.ManagedObject.MetadataOptions.AggregationDnD AggregationDnD}).

Example: <pre>
Element.extend('sap.mylib.MyElement', {
  metadata : {
    library : 'sap.mylib',
    properties : {
      value : 'string',
      width : 'sap.ui.core.CSSSize'
    },
    dnd : { draggable: true, droppable: false },
    aggregations : {
      items : { type: 'sap.ui.core.Control', multiple : true, dnd : {draggable: false, droppable: true, layout: "Horizontal" } },
      header : {type : "sap.ui.core.Control", multiple : false, dnd : true },
    }
  }
});
</pre>

exit.!description:
Hook method for cleaning up the element instance before destruction.

Applications must not call this hook method directly, it is called by the framework when the element is {@link #destroy destroyed}.

Subclasses of Element should override this hook to implement any necessary cleanup.

<pre>
exit: function() {
    // ... do any further cleanups of your subclass e.g. detach events...
    this.$().off("click", this.handleClick);

    if (Element.prototype.exit) {
        Element.prototype.exit.apply(this, arguments);
    }
}
</pre>

For a more detailed description how to to use the exit hook, see Section {@link topic:d4ac0edbc467483585d0c53a282505a5 exit() Method} in the documentation.

getFieldHelpInfo.!description:
This function (if available on the concrete subclass) provides information for the field help.

Applications must not call this hook method directly, it is called by the framework.

Subclasses should implement this hook to provide any necessary information for displaying field help:

<pre>
MyElement.prototype.getFieldHelpInfo = function() {
   return {
     label: "some label"
   };
};
</pre>

getRootControl.!description:
Returns the content of {@link sap.ui.core.UIComponent#createContent}. If you specified a <code>rootView</code> in your metadata or in the descriptor file (manifest.json), you will get the instance of the root view. This getter will only return something if the {@link sap.ui.core.UIComponent#init} function was invoked. If <code>createContent</code> is not implemented, and there is no root view, it will return <code>null</code>. Here is an example: <pre>
         var MyExtension = UIComponent.extend("my.Component", {
              metadata: {
                   rootView: "my.View"
              },
              init: function () {
                   this.getRootControl(); // returns null
                   UIComponent.prototype.init.apply(this, arguments);
                   this.getRootControl(); // returns the view "my.View"
              }
         });
    </pre>

getRouterFor.!description:
Returns the reference to the router instance.

The passed controller or view has to be created in the context of a UIComponent to return the router instance. Otherwise this function will return undefined. You may define the routerClass property in the config section of the routing to make the Component create your router extension.

Example: <pre>
routing: {
	config: {
		routerClass : myAppNamespace.MyRouterClass
		...
}
...
</pre>
